import "./App.css";
import Navbar from "./navbar.js";
import { Link } from "react-router-dom";
import couchImg from "./Assets/couch.png"; // couch image for product page

function Browse() {
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <body>
        {/* header text */}
        <div>
          <h3>Couch Pillow</h3>
          <p>
            All of our hand-made pillows come in your choice of four beautiful
            colors and three luxurious fills.
          </p>
        </div>
        {/* images and captions */}
        <div id="browseImgs">
          <div className="browseItem">
            <Link
              style={{ textDecoration: "none" }}
              className="textLink"
              to="/CouchPillow"
            >
              <img
                className="browseImg"
                src={couchImg}
                alt="Gray couch showing off Fluff Stuff couch pillows"
              ></img>
            </Link>
            <h4>Couch Pillow</h4>
            <h5>$89</h5>
          </div>
        </div>
      </body>
    </div>
  );
}

export default Browse;
